import React, { useEffect, useState } from "react";
import { RouteComponentProps, withRouter } from "react-router";
import { Container } from "../components/Container";
import { Table } from "react-bootstrap";
import { Link } from "react-router-dom";

type ProfileParams = {
  id: string;
};
type ProfileProps = RouteComponentProps<ProfileParams>;

const Profile: React.FC<ProfileProps> = ({ match }) => {
  useEffect(() => {
    fetchItem();
  }, []);

  const [item, setItem] = useState({
    id: Number,
    name: String,
    username: String,
    email: String,
    address: {
      street: String,
      suite: String,
      city: String,
      zipcode: Number,
      geo: {
        lat: Number,
        lng: Number,
      },
    },
    phone: Number,
    website: String,
    company: {
      name: String,
      catchPhrase: String,
      bs: String,
    },
  });

  const fetchItem = async () => {
    const fetchItem = await fetch(
      `https://jsonplaceholder.typicode.com/users/${match.params.id}`
    );
    const item = await fetchItem.json();
    setItem(item);
    // console.log(item);
    // const result = await axios("https://jsonplaceholder.typicode.com/users/1");
    // setdataProfile(result);
    // console.log(result.data);
  };
  console.log(item.id);

  return (
    <div>
      <Container>
        <h2 style={{ textAlign: "center", margin: "20px 0 20px 0" }}>
          Fiche utilisateur
        </h2>
        <Link to="/users">Retour Ã  la liste d'utilisateur</Link>
        <Table striped bordered hover>
          <tbody>
            <tr>
              <td>name</td>
              <td>{item.name}</td>
            </tr>
            <tr>
              <td>username</td>
              <td>{item.username}</td>
            </tr>
            <tr>
              <td>email</td>
              <td>{item.email}</td>
            </tr>
            <tr>
              <td>Album</td>
              <td>...</td>
            </tr>
          </tbody>
        </Table>
      </Container>
    </div>
  );
};
export default withRouter(Profile);
